import React from "react";

export default function TextForm(props) {
  return (
    <div>
      <div className="mb-3">
        <label htmlFor="myBox" className="form-label">
          {props}
        </label>
        <textarea className="form-control" id="myBox" rows="3"></textarea>
      </div>
    </div>
  );
}
